PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE "videos" ("id" SERIAL PRIMARY KEY AUTOINCREMENT NOT NULL, "title" varchar, "duration" integer, "videoId" varchar, "thumbnail" varchar, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "uploaded_on" date);
CREATE TABLE "schema_migrations" ("version" varchar NOT NULL);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX "unique_schema_migrations" ON "schema_migrations" ("version");
COMMIT;
